import React from "react";
// nodejs library that concatenates classes
// @material-ui/core components
import { makeStyles } from "@material-ui/core/styles";

// @material-ui/icons

// core components
import GridContainer from "components/Grid/GridContainer.js";
import GridItem from "components/Grid/GridItem.js";
import Header from "components/Header/Header.js";
import HeaderLinks from "components/Header/HeaderLinks.js";
import CustomDropdown from "components/CustomDropdown/CustomDropdown.js";

import Answer1 from "./FAQQuestions/Answer1.js"
import Answer2 from "./FAQQuestions/Answer2.js"
import Answer3 from "./FAQQuestions/Answer3.js"
import Answer4 from "./FAQQuestions/Answer4.js"
import Answer5 from "./FAQQuestions/Answer5.js"
import Answer6 from "./FAQQuestions/Answer6.js"
import Answer7 from "./FAQQuestions/Answer7.js"


import styles from "assets/jss/material-kit-react/views/landingPage.js";

// Sections for this page


const useStyles = makeStyles(styles);

export default function LandingPage(props) {
    const classes = useStyles();
    const { ...rest } = props;
    return (
        <div className={classes.main}>
            <Header
                color="white"
                brand="TechnoServs"
                fixed
                rightLinks={<HeaderLinks />}
                changeColorOnScroll={{
                    height: 200,
                    color: "white"
                }}
                {...rest}
            />
            <div>
                <GridContainer>
                    <GridItem>
                        <br /><br /><br /><br />
                    </GridItem>
                    <GridItem xs={12} sm={12} md={2}>
                    </GridItem>
                    <GridItem xs={12} sm={12} md={10}>
                        <h1>FAQ</h1>
                        <CustomDropdown
                            noLiPadding
                            buttonText="Je n’arrive pas à avoir accès à mon compte."
                            buttonProps={{
                                className: classes.navLink,
                                color: "transparent"
                            }}
                            dropdownList={[
                                <Answer1/>
                            ]}
                        />
                        <CustomDropdown
                            noLiPadding
                            buttonText="Je n’ai pas reçu le mail de confirmation."
                            buttonProps={{
                                className: classes.navLink,
                                color: "transparent"
                            }}
                            dropdownList={[
                                <Answer2/>
                            ]}
                        />
                        <CustomDropdown
                            noLiPadding
                            buttonText="J’ai oublié mon mot de passe."
                            buttonProps={{
                                className: classes.navLink,
                                color: "transparent"
                            }}
                            dropdownList={[
                                <Answer3/>
                            ]}
                        />
                        <CustomDropdown
                            noLiPadding
                            buttonText="Où puis-je signaler un bug ?"
                            buttonProps={{
                                className: classes.navLink,
                                color: "transparent"
                            }}
                            dropdownList={[
                                <Answer4/>
                            ]}
                        />
                        <CustomDropdown
                            noLiPadding
                            buttonText="Certains onglets ne fonctionnent pas dans le dashboard."
                            buttonProps={{
                                className: classes.navLink,
                                color: "transparent"
                            }}
                            dropdownList={[
                                <Answer5/>
                            ]}
                        />
                        <CustomDropdown
                            noLiPadding
                            buttonText="Lorsque je suis sur téléphone, le site ne fonctionne pas."
                            buttonProps={{
                                className: classes.navLink,
                                color: "transparent"
                            }}
                            dropdownList={[
                                <Answer6/>
                            ]}
                        />
                        <CustomDropdown
                            noLiPadding
                            buttonText="Les ressources utilisées du serveur ne semblent pas être correctes."
                            buttonProps={{
                                className: classes.navLink,
                                color: "transparent"
                            }}
                            dropdownList={[
                                <Answer7/>
                            ]}
                        />
                    </GridItem>
                </GridContainer>
            </div>
        </div>
    );
}
